import logo from './logo.svg';
import './App.css';
import DragNDrop from './DragNDropComponent/DragNDrop';
import { useState, useEffect, useRef } from 'react';
import EditImage from './EditImageComponent/EditImage';
import Headerline from './HeaderLineComponent/Headerline';

const base64Image = " data:image/jpeg;base64,"

export default function App() {
  const canvasRef = useRef(null);
  const imgRef = useRef(null);
  const ctxRef = useRef(null);
  const editor = useRef(null);
  
  const gradient = "  .-:oM@";
  const scaler =4;
  const scaler2 =2;
  const [stringMessage, setStringMessage] = useState("");
  const [file, setFile] = useState();

useEffect(()=>{
  const context = canvasRef.current.getContext('2d');
  ctxRef.current = context;

},[])

  const getPixels = () => 
    {      
      let width = imgRef.current.width;
      let height = imgRef.current.height;

    
      const imageData = ctxRef.current.getImageData(0, 0, width, height);
            
        let row = 0;
        let col = 0;
    
        const pixels = new Array(height).fill(0).map(() => []);      
        let curr = pixels[row];
    
        for (let i = 0; i < imageData.data.length; i += 4)
        {
            const avg = (imageData.data[i] + imageData.data[i + 1] + imageData.data[i + 2]) / 3;
            curr = pixels[row]
            curr.push(avg)
                
            col++;                    
            if (col >= width)
            {
                col = 0;
                row++;
            }
        }
        return pixels;
    }
    
    const getCharByScale = (scale) => 
    {
        let pos = Math.floor(scale / 255 * (gradient.length - 1));
        return gradient[pos];
    }

    const renderImg = (textDarkScale) =>
    {
       
    let text = "";
        for (let i = 0; i < textDarkScale.length; i+=scaler)
          { 
            for (let k = 0; k < textDarkScale[i].length; k+=scaler2) 
              {
                text+=getCharByScale(textDarkScale[i][k]);
              }                
            text+="\n";
          }
          setStringMessage(text);
  }

  const convertImage =() =>{
    if(imgRef.current != null)
      renderImg(getPixels());
  }
    const setFilters = (filters) => 
      {
        ctxRef.current.filter = filters;
        ctxRef.current.drawImage(imgRef.current,0,0,canvasRef.current.width,canvasRef.current.height  )
      }

  const updImage = () =>{
    canvasRef.current.width = imgRef.current.width;
    canvasRef.current.height = imgRef.current.height;
    ctxRef.current.drawImage(imgRef.current,0,0,canvasRef.current.width,canvasRef.current.height  )

  }
  
  return (
    <>    
      <div>
      <Headerline/>
      <img
                src={file == null? "": URL.createObjectURL(file)}   
                alt="No image now"
                ref={imgRef}
              />       
        <div class = "main-container">                  
          <div class ="image-container">

             <DragNDrop onFilesSelected={setFile} image = {ctxRef.current}  width="300px" height='250px'/> 
            <div class ="buttons-container">
              <span  class ="button" onClick={updImage} >
                  Select
              </span>
            </div>       
              <div>
                <p>Current image:</p>
                <canvas class = "imgCanvas"  ref={canvasRef}></canvas>       
              </div>
              <EditImage onApply ={setFilters}/>
              <div class ="buttons-container">
            <span  class ="button" onClick={convertImage} >
                Convert
            </span>
          </div>
          </div>      
             <div class = "rendered-image-container">
              <pre>
                {stringMessage}
              </pre>
             </div>
          </div>
        
      </div>
    </>

)
}

